import styled from "styled-components"

const AccountPage = styled.div`
    width:80vw;
    margin:0 auto;
    height:100vw;
    text-align:center;
    padding:150px 0 20px 0;
    .subheading{
        margin:30px 0
    }
`

export default AccountPage
